css:
@-moz-document url-prefix("https://www.justeat.it/orders/") {
body {
    color: white;
}

main, .c-orderDetail-status, .table, table, .u-lightenBg, .c-orderDetail-app, .c-orderDetail-marketing, .c-footer, .c-footer-row--light {
    background-color: var(--bgc);
}

:root {
    --bgc: #414141;
}

.c-progressBar-rays {
    filter: invert(0.7);
}

.c-orderSummary-payment {
    background: #fff;
    background-color: var(--bgc);
}

.alpha, .beta, .delta, .epsilon, .gamma, h1, h2, h3, h4, h5, h6, .c-footer {
    color: white;
}

.c-orderDetail-help {
    background-color: #383838;
}

.is-collapsed .c-orderSummary-payment {
    box-shadow: none;
}

.c-footer-panel a {
    color: white;
}

a {
    color: #4899fd;
}
}
